list.TUTORIAL_NEXT_DESCRIPTION:
Il bot funzioner e gli utenti potranno inviare suggerimenti dopo che `{{prefix}}setup`  stato usato. Se cerchi opzioni pi avanzate, come reazioni personalizzate o la pulizia automatica dei comandi, dai un'occhiata a https://suggester.js.org/#/admin/config

Se sei in difficolt o vuoi saperne di pi sul bot, entra nel __server di supporto di Suggester__: {{invite}}
Questo incorporamento pu essere mostrato in qualsiasi momento con il comando `{{prefix}}tutorial`.

