list.TUTORIAL_NEXT_DESCRIPTION_NEW:
Dopo aver usato `{{prefix}}setup`, il bot funzioner e gli utenti saranno in grado di inviare suggerimenti. Se sei in cerca di opzioni pi avanzate come cambiare le reazioni ai post nel feed o la pulizia automatica dei comandi, usa `{{prefix}}config`.

Se riscontri problemi, o vuoi saperne di pi sul bot, entra nel __server di supporto di Suggester__: {{invite}}
Questo messaggio pu essere mostrato in qualsiasi momento con il comando `{{prefix}}tutorial`.
